import './App.css';
import React from "react";

// コンポーネントの書き方は主に以下２つ

// classコンポーネント
class HelloMessageClass extends React.Component {
  render() {
    return <div>Hello!!</div>
  }
}

// 関数コンポーネント
const HelloMessageFunction = () => <div>Hello!!!!!</div>;

export default function App() {
  return (
    <>
      <HelloMessageClass />
      <HelloMessageFunction />
    </>
  );
}

